import React, { Component } from 'react'
import Sidebar from './sidebar/Sidebar';

import Welcome from './container/Welcome';
import OpenConversation from './container/OpenConversation';

import ChannelsContext from '../contexts/ChannelsProvider';

// Main
class Dashboard extends Component {
  static contextType = ChannelsContext

  render() {
    const selectedConversation = this.context.selectedChannel

    return (
      <>
        <Sidebar />
        <div className="container">
          {
            selectedConversation !== undefined ? selectedConversation && <OpenConversation /> : <Welcome />
          }
        </div>
      </>
    )
  }
}

export default Dashboard
